import React from 'react';
import { Link } from "react-router-dom";
import '../css/Navigation.css';

class Navigation extends React.Component {
  state = {

  }
  render() {

    return (
      <div>
        <Link to={`/home`}>
          <button className="link"onMouseOver={() => {}}>
            Home
          </button>
        </Link>
        <Link to={`/about`}>
          <button className="link">
            About
          </button>
        </Link>
        <Link to={`/portfolio`}>
          <button className="link">
            Portfolio
          </button>
        </Link>
        <Link to={`/resume`}>
          <button className="link">
            Resume
          </button>
        </Link>
        <Link to={`/contact`}>
          <button className="link">
            Contact
          </button>
        </Link>
      </div>
  )
} 
}

export default Navigation;
